import React from "react"
import "./Definations.css"

const Definations = ({ word, meanings, category }) => {
  return (
    <div className='meanings'>
      {word === "" ? (
        <span className='subTitle'>Start by typing...</span>
      ) : (
        meanings.map((mean) => mean.meanings.map((item) => (
            item.defination.map((def)=>(
                <div className="singleMean" style={{backgroundColor:"white", color:"black"}}>
                    <b>{def.defination}</b>
                </div>
            ))
        )))
      )}
    </div>
  )
}

export default Definations
